import './App.css';
import Header from './components/Header/Header.js';
import Footer from './components/Footer/Footer';
import Container from './components/Container/Container';


const App = ()=>{
    return(
        <>
        <h1>hello</h1>
        <Header/>
        <Container/>
        <Footer/>
        </>
    )
};

export default App;
